DROP TABLE IF EXISTS `aff_t_journal`;
CREATE TABLE `aff_t_journal`  (
  `j_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `today_work_content` varchar(3000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '工作内容',
  `attachment_id` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '附件id，和附件表关联，多个附件以逗号隔开',
  `submitter` int(255) NULL DEFAULT NULL COMMENT '提交人',
  `submit_time` date NULL DEFAULT NULL COMMENT '提交时间',
  `receiver` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '接收人id,多个以逗号隔开',
  `unfinished_work` varchar(3000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '未完成工作',
  `coordinated_work` varchar(3000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '需协调工作',
  `uniqueid` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '单独性字段',
  PRIMARY KEY (`j_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 41 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

